window.bookSummaryJSON = "<p>Discover the definitive history of DARPA, the Defense Advanced Research Project Agency, in this Pulitzer Prize finalist from the author of the <i>New York Times </i>best seller <i>Area 51</i>.</p> <p>No one has ever written the history of the Defense Department's most secret, most powerful, and most controversial military science R&amp;D agency. In the first-ever history about the organization, <i>New York Times</i> best-selling author Annie Jacobsen draws on inside sources, exclusive interviews, private documents, and declassified memos to paint a picture of DARPA, or \"the Pentagon's brain\", from its Cold War inception in 1958 to the present.</p> <p>This is the audiobook on DARPA - a compelling narrative about this clandestine intersection of science and the American military and the often frightening results.</p>"; 
